package modelo;public class conversion {    private String monedaBase;    private String monedaDestino;    private double cantidad;    private double resultado;    public conversion(String monedaBase, String monedaDestino, double cantidad, double resultado) {        this.monedaBase = monedaBase;        this.monedaDestino = monedaDestino;        this.cantidad = cantidad;        this.resultado = resultado;    }    public String getMonedaBase() {        return monedaBase;    }    public void setMonedaBase(String monedaBase) {        this.monedaBase = monedaBase;    }    public String getMonedaDestino() {        return monedaDestino;    }    public void setMonedaDestino(String monedaDestino) {        this.monedaDestino = monedaDestino;    }    public double getCantidad() {        return cantidad;    }    public void setCantidad(double cantidad) {        this.cantidad = cantidad;    }    public double getResultado() {        return resultado;    }    public void setResultado(double resultado) {        this.resultado = resultado;    }    @Override    public String toString() {        return " Moneda='" + monedaBase + '\'' +                ",\n Conversion='" + monedaDestino + '\'' +                ",\n cantidad=" + cantidad +                ",\n resultado=" + resultado;    }}